import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class Movie extends Component {
    static propTypes = {
        movie: PropTypes.shape({

        })
    }

    render() {
        return (
            <div>
            <h3>{this.props.movie.title}</h3>
            <p>{this.props.movie.desc}</p>
          </div>
        )
    }
}
